column8:
シルク待針＜耐熱＞<br><br>

頭がガラス製の極細タイプ。薄地に最適です。<br><br>

クロバーの待針は布にスムーズに通るので布を痛めません。<br><br>

◆種類・内容　100本入　太さ0.5mm×長さ36mm　プラスチックケース入<br>
◆P.サイズ　45×65×15mm<br><br>

<p>メーカー希望小売価格はメーカーカタログに基づいて掲載しています</p><br><br><style type="text/css">
